import { useState, useEffect } from "react";
import { useParams, useNavigate } from "react-router-dom";
import { ficha_get } from "../../services/ficha.services";
import Swal from "sweetalert2";
import { jsPDF } from "jspdf";
import "jspdf-autotable";
import { getUser } from "../../services/auth.service";
import {
  Seccion_get,
  serie_get,
  subserie_get,
} from "../../services/cuadro.service";
import { seccion, serie, SubSerie } from "../../services/var.cuadro";

interface User {
  first_name: string;
  last_name: string;
  role?: string;
}

interface Ficha {
  id_ficha: string | number;
  ficha: string;
  area_resguardante: string;
  area_intervienen: string;
  descripcion: string;
  soporte_docu: string;
  seccion: string | number;
  serie: string | number;
  subserie: number | null; // Permitir que subserie sea null
  topologia: string;
  catalogo: string;
  nombre_seccion?: string | null;
  nombre_serie?: string | null;
  nombre_subserie?: string | null;
  created_by?: User;
  created_at?: string;
}

export const ImprimirFicha: React.FC = () => {
  const { id } = useParams<{ id: string }>();
  const navigate = useNavigate();
  const [ficha, setFicha] = useState<Ficha | null>(null);
  const [isLoading, setIsLoading] = useState<boolean>(true);
  const [currentUser, setCurrentUser] = useState<User | null>(null);
  const seccionResponse = Seccion_get();
  const serieResponse = serie_get();
  const subserieResponse = subserie_get();
  const [error, setError] = useState<string | null>(null);
  const [availableIds, setAvailableIds] = useState<string[]>([]);

  useEffect(() => {
    const loadFichaData = async () => {
      if (!id) {
        navigate("/Ficha");
        return;
      }

      try {
        setIsLoading(true);
        setError(null);

        const response = await ficha_get();

        if (!response || response.length === 0) {
          throw new Error("No se encontraron fichas");
        }

        const ids = response.map((ficha: Ficha) => String(ficha.id_ficha));
        setAvailableIds(ids);

        const item = response.find(
          (ficha: Ficha) => String(ficha.id_ficha) === String(id)
        );

        if (!item) {
          await Swal.fire({
            icon: "error",
            title: "Ficha No Encontrada",
            text: `No se encontr贸 la ficha con ID ${id}`,
            footer: `IDs disponibles: ${ids.join(", ")}`,
            confirmButtonText: "Volver a Fichas",
          });
          navigate("/Ficha");
          return;
        }

        const seccionResponse = await Seccion_get();
        const serieResponse = await serie_get();
        const subserieResponse = await subserie_get();

        const nombreSeccion = seccionResponse.find(
          (seccion: seccion) =>
            String(seccion.id_seccion) === String(item.seccion)
        )?.seccion;

        const nombreSerie = serieResponse.find(
          (serie: serie) => String(serie.id_serie) === String(item.serie)
        )?.serie;

        const nombreSubserie = subserieResponse.find(
          (subserie: SubSerie) =>
            String(subserie.id_subserie) === String(item.subserie)
        )?.subserie;

        setFicha({
          ...item,
          nombre_seccion: nombreSeccion || null,
          nombre_serie: nombreSerie || null,
          nombre_subserie: nombreSubserie || null,
        });
      } catch (error) {
        const errorMessage =
          error instanceof Error
            ? error.message
            : "Error desconocido al cargar datos";

        console.error("Error al cargar datos:", error);
        setError(errorMessage);

        await Swal.fire({
          icon: "error",
          title: "Error de Carga",
          text: errorMessage,
          confirmButtonText: "Volver a Fichas",
        });

        navigate("/Ficha");
      } finally {
        setIsLoading(false);
      }
    };

    loadFichaData();
  }, [id, navigate]);

  useEffect(() => {
    const user = getUser();
    if (user) {
      setCurrentUser({
        first_name: user.first_name,
        last_name: user.last_name,
      });
    }
  }, []);

  useEffect(() => {
    const fetchFicha = async () => {
      if (!id) {
        navigate("/Ficha");
        return;
      }

      try {
        setIsLoading(true);

        const response = await ficha_get();

        if (!response || response.length === 0) {
          throw new Error("No se encontraron fichas");
        }

        const item = response.find(
          (port: Ficha) => String(port.id_ficha) === String(id)
        );

        if (!item) {
          await Swal.fire({
            icon: "error",
            title: "Ficha No Encontrada",
            text: `No se encontr贸 la Ficha con ID ${id}`,
            confirmButtonText: "Volver a Fichas",
          });
          navigate("/Ficha");
          return;
        }

        setFicha(item);
      } catch (error) {
        const errorMessage =
          error instanceof Error
            ? error.message
            : "Error desconocido al cargar datos";

        console.error("Error al cargar datos:", error);

        await Swal.fire({
          icon: "error",
          title: "Error de Carga",
          text: errorMessage,
          confirmButtonText: "Volver a Fichas",
        });

        navigate("/Ficha");
      } finally {
        setIsLoading(false);
      }
    };

    fetchFicha();
  }, [id, navigate]);
  const generarPDF = () => {
    if (!ficha || !currentUser) {
      Swal.fire({
        icon: "error",
        title: "Error",
        text: "No se encontr贸 la ficha o el usuario para generar el PDF.",
      });
      return;
    }

    try {
      const doc = new jsPDF("portrait"); // Orientaci贸n vertical

      // Colores
      const primaryColor: [number, number, number] = [0, 51, 102];
      const textColor: [number, number, number] = [51, 51, 51];

      // Logo
      const logo =
        "data:image/png;base64,"; // Aseg煤rate de tener la ruta correcta
      doc.addImage(logo, "PNG", 15, 10, 30, 30);

      // T铆tulo principal
      doc.setFontSize(24); // Tama帽o de fuente para el t铆tulo
      doc.setTextColor(...primaryColor);
      doc.setFont("helvetica", "bold");

      // Ajustar el t铆tulo para que no exceda el ancho de la p谩gina
      const title = "FICHA TCNICA DE VALORACIN DOCUMENTAL";
      const maxTitleWidth = doc.internal.pageSize.width - 30; // Margen de 15px a cada lado
      const titleLines = doc.splitTextToSize(title, maxTitleWidth);
      const titleHeight = titleLines.length * 10; // Altura del t铆tulo (10px por l铆nea)
      doc.text(titleLines, doc.internal.pageSize.width / 2, 50, {
        align: "center",
      });

      // Subt铆tulo (se ajusta din谩micamente debajo del t铆tulo)
      doc.setFontSize(18); // Tama帽o de fuente para el subt铆tulo
      doc.setTextColor(...textColor);
      doc.setFont("helvetica", "normal");

      const subtitle = "Miracle Business Network S.A de C.V";
      const maxSubtitleWidth = doc.internal.pageSize.width - 30; // Margen de 15px a cada lado
      const subtitleLines = doc.splitTextToSize(subtitle, maxSubtitleWidth);
      const subtitleHeight = subtitleLines.length * 8; // Altura del subt铆tulo (8px por l铆nea)
      doc.text(
        subtitleLines,
        doc.internal.pageSize.width / 2,
        50 + titleHeight + 10,
        {
          align: "center",
        }
      );

      // L铆nea divisoria (debajo del subt铆tulo)
      const lineY = 50 + titleHeight + subtitleHeight + 15; // Posici贸n de la l铆nea
      doc.setDrawColor(...primaryColor);
      doc.line(15, lineY, doc.internal.pageSize.width - 15, lineY);

      // Informaci贸n de la ficha
      let startY = lineY + 20; // Posici贸n inicial para la informaci贸n (debajo de la l铆nea)
      const leftColumn = 20; // Columna izquierda
      const rightColumn = doc.internal.pageSize.width / 2 + 10; // Columna derecha
      const lineHeight = 10; // Espaciado entre l铆neas

      doc.setFontSize(12); // Tama帽o de fuente para la informaci贸n
      doc.setTextColor(...textColor);

      // Funci贸n para manejar texto largo y calcular la altura
      const drawText = (
        text: string,
        x: number,
        y: number,
        maxWidth: number
      ) => {
        const lines = doc.splitTextToSize(text, maxWidth);
        doc.text(lines, x, y);
        return lines.length * lineHeight; // Retorna la altura ocupada
      };

      // Columna Izquierda
      const leftColumnData = [
        `N煤mero de Ficha: ${ficha.id_ficha}`,
        `rea Resguardante: ${ficha.area_resguardante}`,
        `reas que Intervienen: ${ficha.area_intervienen}`,
        `Descripci贸n: ${ficha.descripcion}`,
        `Soporte Documental: ${ficha.soporte_docu}`,
      ];

      // Columna Derecha
      const rightColumnData = [
        `Tipolog铆a: ${ficha.topologia}`,
        `Secci贸n: ${ficha.nombre_seccion}`,
        `Serie: ${ficha.nombre_serie}`,
        `Subserie: ${ficha.nombre_subserie}`,
      ];

      // Renderizar columnas y calcular la altura total
      let leftColumnHeight = 0;
      leftColumnData.forEach((text) => {
        const height = drawText(
          text,
          leftColumn,
          startY + leftColumnHeight,
          80
        ); // 80 es el ancho m谩ximo
        leftColumnHeight += height;
      });

      let rightColumnHeight = 0;
      rightColumnData.forEach((text) => {
        const height = drawText(
          text,
          rightColumn,
          startY + rightColumnHeight,
          80
        ); // 80 es el ancho m谩ximo
        rightColumnHeight += height;
      });

      // Calcular la altura m谩xima entre las dos columnas
      const maxHeight = Math.max(leftColumnHeight, rightColumnHeight);

      // Posici贸n de las firmas (debajo de la informaci贸n con un margen de 20px)
      const signaturesStartY = startY + maxHeight + 20;

      // Firmas
      const signatureWidth = 60; // Ancho de la l铆nea de firma

      const signatures = [
        {
          name: "Elabor贸",
          person: `${currentUser.first_name} ${currentUser.last_name}`,
          x: 30,
        },
        {
          name: "Revis贸",
          person: "Wilson S谩nchez",
          x: 120,
        },
        {
          name: "Autoriz贸",
          person: "",
          x: 210,
        },
      ];

      doc.setDrawColor(0, 0, 0); // Color de la l铆nea de firma
      doc.setFontSize(10); // Tama帽o de fuente para las firmas

      signatures.forEach((signature) => {
        // L铆nea de firma
        doc.line(
          signature.x,
          signaturesStartY,
          signature.x + signatureWidth,
          signaturesStartY
        );

        // Nombre del firmante
        doc.text(
          signature.person,
          signature.x + signatureWidth / 2,
          signaturesStartY + 10,
          { align: "center" }
        );

        // Tipo de firma
        doc.setFontSize(9); // Tama帽o de fuente para el tipo de firma
        doc.text(
          signature.name,
          signature.x + signatureWidth / 2,
          signaturesStartY + 30,
          { align: "center" }
        );
      });

      // Pie de p谩gina (fijo en la parte inferior)
      const currentDate = new Date().toLocaleString();
      doc.setFontSize(8); // Tama帽o de fuente para el pie de p谩gina
      doc.setTextColor(...textColor);
      doc.text(
        `Generado el: ${currentDate}`,
        doc.internal.pageSize.width - 20,
        doc.internal.pageSize.height - 10, // Fijo en la parte inferior
        { align: "right" }
      );

      // Guardar PDF
      doc.save(`Ficha_${ficha.id_ficha || "sin_numero"}.pdf`);
    } catch (error) {
      console.error("Error al generar PDF:", error);
      Swal.fire({
        icon: "error",
        title: "Error",
        text: "No se pudo generar el PDF. Intente nuevamente.",
      });
    }
  };
  if (isLoading) {
    return <div className="p-4 text-center">Cargando...</div>;
  }

  if (!ficha) {
    return (
      <div className="p-4 text-center text-red-500">
        No se encontr贸 el n煤mero de ficha
      </div>
    );
  }

  return (
    <div className="min-h-screen bg-gray-50 pt-16">
      <div className="p-4 max-w-4xl mx-auto">
        <div className="border rounded-lg p-4 shadow-sm bg-white">
          <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
            {[
              { label: "N煤mero de Ficha", value: ficha.id_ficha },
              { label: "rea Resguardante", value: ficha.area_resguardante },
              { label: "reas que Intervienen", value: ficha.area_intervienen },
              { label: "Descripci贸n", value: ficha.descripcion },
              { label: "Soporte Documental", value: ficha.soporte_docu },
              { label: "Tipolog铆a", value: ficha.topologia },
              { label: "Secci贸n", value: ficha.nombre_seccion },
              { label: "Serie", value: ficha.nombre_serie },
              { label: "Subserie", value: ficha.nombre_subserie },
            ].map((item, index) => (
              <div key={index} className="border-b pb-2">
                <strong className="text-gray-700">{item.label}:</strong>{" "}
                <span className="text-gray-900">{item.value}</span>
              </div>
            ))}
          </div>
        </div>
        <div className="mt-6 flex justify-center">
          <button
            onClick={generarPDF}
            className="bg-blue-700 text-white px-6 py-2 rounded-lg hover:bg-blue-800 transition-colors shadow-md"
          >
            Generar PDF
          </button>
        </div>
      </div>
    </div>
  );
};

export default ImprimirFicha;
